import React, { Component } from 'react';
class Weather extends Component {
    constructor(props){
        super(props)

    }
    render(){
        return(
            <div>
            <h1>HEY this is the weather page</h1>
            <p>{this.props.nyWeather.list[0].dt_txt}</p>
            </div>
        )
    }
}

export default Weather;
